exports.buildSmartphone = (paper, appName, x) => {
    let body = paper.path(STRING_PHONE_BODY);
    display = paper.path(STRING_PHONE_DISPLAY);
    let speaker = paper.path(STRING_PHONE_SPEAKER);
    let arm = paper.path(STRING_PHONE_ARM);

    let xPos = x ? x + 50 : 50;

    body.attr({ fill: '#a1d9ec' }).transform(`S0.8,0.8,0,0T${xPos},70`);
    display.attr({ fill: '#000' }).transform(`S0.8,0.8,0,0T${xPos},70`).toBack();
    speaker.attr({ fill: '#454545' }).transform(`S0.8,0.8,0,0T${xPos},70`);
    arm.attr({ fill: '#f8cd7a' }).transform(`S0.8,0.8,0,0T${xPos},70`);

    xPos += 205;
    paper.text(xPos, '24.5%', appName.toUpperCase()).attr({ 'font-size': 13, 'font-weight': 'bold', fill: '#fff', 'text-anchor': 'middle' });
};

exports.buildInput = (paper) => {
    let keyBg = paper.path(STRING_KEYBOARD_BG);
    let grid = paper.path(STRING_KEYBOARD_GRID);
    let input1 = paper.path(STRING_INPUT_OLD);
    let input2 = paper.path(STRING_INPUT_NEW);
    let keys = paper.path(STRING_KEYBOARD_KEYS);

    keyBg.attr({ fill: '#555' }).transform('S0.6,0.45,0,0T168,295').toBack();
    keys.attr({ fill: '#fff' }).transform('S0.6,0.45,0,0T168,295');
    grid.attr({ fill: '#dbe82d' }).transform('S0.5,0.5,0,0T195,150');
    input1.attr({ fill: '#888' }).transform('S0.5,0.5,0,0T195,150');
    input2.attr({ fill: '#eee' }).transform('S0.5,0.5,0,0T195,150');

    if(display) display.toBack();

};

exports.buildSmartphoneUser = (paper, nameTag) => {
    //Person Graphic + Smartphone
    let person = paper.path(STRING_PERSON);
    let smartphone = paper.path(STRING_PERSON_PHONE);
    person.transform('s0.8,0.8t100,0');
    smartphone.transform('s0.8,0.8t79,34');
    person.attr({ fill: '#f8cd7a' });
    smartphone.attr({ fill: '#ADD8E6' });
    paper.text('40%', '40%', nameTag[0].toUpperCase()).attr({ 'font-size': 40, 'font-weight': 'bold' });
};

exports.buildCheck = (paper, x, y) => {
    let check = paper.path(STRING_CHECK);
    check.attr({ fill: '#7dc39f' }).transform('t' + x + ',' + y + 's0.75, 0.75');
};

exports.buildFingerPress = (paper) => {
    let finger = paper.path(STRING_FINGER);
    let press = paper.path(STRING_FINGER_PRESS);

    finger.attr({ fill: '#f8cd7a' }).transform('t200,280s0.8,0.8,0,0');
    press.attr({ fill: '#ee5533', opacity: '0.75' }).transform('t200,280s0.8,0.8,0,0');
};

exports.buildPlus = (paper) => {
    let plus = paper.path(STRING_PLUS);
    plus.attr({ fill: '#eee', stroke: 'none', 'border-radius': 5  }).transform('t235,200s10,10,0,0');
};

exports.buildChart = (paper, yLabel) => {
    let chart = paper.path(STRING_CHART);
    chart.attr({ fill: '#dce831', stroke: 'none' }).transform('t195,170s0.7,0.7,0,0');
    paper.text(330, 148, 't').attr({ 'font-size': 24, 'font-weight': 'bold', 'font-style': 'italic', fill: '#dce831', 'text-anchor': 'middle' });
    paper.text(200, 80, yLabel).attr({ 'font-size': 18, 'font-weight': 'bold', 'font-style': 'italic', fill: '#dce831', 'text-anchor': 'middle' });
};

exports.buildOrganization = (paper, organizationLabel) => {
    let building1 = paper.path(STRING_BUILDING_MAIN);
    let building2 = paper.path(STRING_BUILDING_PART);

    building1.attr({ fill: '#baaf93' }).transform('t330,5s0.8,0.8,0,0');
    building2.attr({ fill: '#d1c9b7' }).transform('t330,5s0.8,0.8,0,0');

    paper.text(395, 13, organizationLabel).attr({ 'font-size': 16, 'font-weight': 'bold', 'font-style': 'bold', fill: '#000', 'text-anchor': 'middle' });

};

exports.buildDownstream = (paper) => {
    let stream = paper.path(STRING_DOWNSTREAM);
    stream.attr({ fill: '#7dc39f', stroke: 'none' }).transform('t310,175s0.6,0.6,0,0').toBack();
};

exports.buildUpstream = (paper) => {
    let stream = paper.path(STRING_UPSTREAM);
    stream.attr({ fill: '#7dc39f', stroke: 'none' }).transform('t310,175s0.6,0.6,0,0').toBack();
};

exports.buildCloud = (paper, label) => {
    let cloud = paper.path(STRING_CLOUD);
    cloud.attr({ fill: '#fff', stroke: 'none' }).transform('t160,220s0.7,0.7,0,0');

    paper.text('43%', '62.5%', label).attr({ 'font-size': 16, 'font-weight': 'bold', fill: '#fff', 'text-anchor': 'middle' });
};